description:
Verenigde Staten
Komedie / Romantiek
97 minuten

goed

met Matthew McConaughey, Sarah Jessica Parker en Kathy Bates

De 35-jarige Tripp is niet bepaald een loser te noemen. Toch woont hij nog steeds bij zijn ouders. Altijd had hij wel een reden 
om nog bij paps en mams te blijven hangen. Helaas hebben zijn ouders inmiddels schoongenoeg van hem, maar ze kunnen hun zoon 
maar niet zover krijgen dat hij op zichzelf gaat wonen. Ze besluiten de aantrekkelijke en succesvolle Paula in te huren, die 
garandeert dat dat ze Tripp binnen niet al te lange tijd 'zelfstandig' kan maken:
